import React from "react";
import styles from './Header.module.scss'
import { Link } from "react-router-dom";

const data = [
    {
        id: 1,
        title: 'Jordan',
        to: '/jordan'
    }
]

const Header = ({ handleChoose, code, onChangeValue, onChangeSize, size, handleClick }) => {
    return (
        <div className={styles.header}>
            <div className={styles.type}>
                <button className={styles.itemHeader} onClick={(e) => handleChoose(e)}>Jordan</button>
                <button className={styles.itemHeader} onClick={(e) => handleChoose(e)}>Air Force 1</button>
                <button className={styles.itemHeader} onClick={(e) => handleChoose(e)}>Air Max</button>
            </div>
            <div className={styles.search}>
                <input
                    placeholder='Code...'
                    className={styles.input}
                    value={code}
                    onChange={(e) => onChangeValue(e)}
                />
                <input
                    placeholder='Size...'
                    className={styles.input}
                    style={{ width: '50px' }}
                    value={size}
                    onChange={(e) => onChangeSize(e)}
                />
                <Link
                    className={styles.btn}
                    onClick={handleClick}
                    to='/detailsneaker'
                >
                    Submit
                </Link>
            </div>
            <div className={styles.filter}>
            </div>


        </div>
    )
}

export default Header;
